--(a) Um procedimento para gerar uma tabela VendasMes contendo o nome de
--cada vendedor, o mês e o valor total das vendas por mês.

CREATE TABLE vendasMes(
nomevend VARCHAR,
ano INTEGER,
mes INTEGER,
sum DOUBLE PRECISION 
);

CREATE OR REPLACE FUNCTION calcula_vendasMes()
RETURNS void AS $$
BEGIN

DELETE FROM vendasMes;
SELECT vendedor.nomevend, EXTRACT('year' FROM pedido.data) AS ano, EXTRACT('month' FROM pedido.data) AS mes, sum(produto.valunit *itemped.quant)
FROM itemped, pedido, produto, vendedor
WHERE itemped.numped = pedido.numped
AND itemped.codprod = produto.codprod
AND vendedor.codvend = pedido.codvend
GROUP BY vendedor.nomevend, mes, ano
ORDER BY vendedor.nomevend, ano, mes;
END
$$ LANGUAGE 'plpgsql';

SELECT calcula_vendasMes();
SELECT * FROM vendasMes;

--(b) Um procedimento para atualizar a tabela VendasMes contendo o nome de
--cada vendedor, o mês e o valor total das vendas por mês. A função deve
--receber uma data como parâmetro para processar apenas os pedidos do mês
--presente na data. 
CREATE TABLE vendasMes(
nomevend VARCHAR,
ano INTEGER,
mes INTEGER,
sum DOUBLE PRECISION 
);

CREATE OR REPLACE FUNCTION atualiza_vendasMes(integer ano, integer mes)
RETURNS void AS $$
BEGIN

UPDATE vendasMes
SET nomevend = vendedor.codvend, ano = EXTRACT('year' FROM pedido.data), mes = EXTRACT('month' FROM pedido.data), sum = sum(produto.valunit *itemped.quant)
FROM itemped, pedido, produto, vendedor
WHERE itemped.numped = pedido.numped
AND itemped.codprod = produto.codprod
AND vendedor.codvend = pedido.codvend
WHERE ano = 0 AND mes = 0;

END
$$ LANGUAGE 'plpgsql';

